INSERT INTO `theme_pages` (`id`, `name`, `content`, `authenticate`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Privacy Policy', '<h3>IN THE BLACK PRIVACY POLICY</h3><p>This Privacy Policy applies to www.theblack.ca, which is owned and operated by IN THE BLACK CAPITAL INC, (IN THE BLACK, Us, or We). This Privacy Policy describes how IN THE BLACK collects and uses the personal information you provide on our website www.theblack.ca (Website) in order to provide our merchant cash advances (MCAs) and service the MCA (collectively, the Service). It also describes the choices available to you regarding our use of your personal information and how you can access and update such information. For purposes of this Privacy Policy, Personal Information means information that personally identifies you, including your contact information, IP address and merchant cash advance application information. A large portion of the Personal Information we collect, use, share, and store is sensitive in nature, including your social insurance number and financial account information (Sensitive Personal Information).</p><h4><strong>Information We Collect.&nbsp;</strong></h4><p>We collect the following information from you:</p><ul><li>Contact information such as name, email address, mailing address, and phone number;</li><li>Financial information such as, bank statements, credit card statements, your average bank balance, personal and business credit history, payment behaviour, bank account information, and tax ID number;</li><li>Social insurance number;</li><li>Unique identifiers such as username and password, and IP address; and</li><li>Business information including company name, company size, and business type.</li><li>We may also conduct a site visit to collect information. We supplement the data you provide with your credit score obtained from the three credit bureaus. Once you are a IN THE BLACK customer, we may reach out to you for information again if you decide to renew your cash advance or loan.</li></ul><h4><strong>Use of Information.</strong>&nbsp;</h4><p>We use the information we collect to:</p><ul><li>Compile, save, use and analyze your Personal Information in both a personally-identifiable form and an aggregated, non-personally identifiable form;</li><li>Operate, maintain, improve, and provide to you the Service and to conduct our business;</li><li>Verify your identity;</li><li>Register you as a user and identify you when you sign in to your account;</li><li>Determine whether or not you qualify for our MCA product;</li><li>Process your account, including deducting automatic payments;</li><li>Communicate with you to send order confirmations, respond to customer service requests, send marketing communications, and send account update notifications; and</li><li>File any PPSA financing statement, lien entry form, hypothec registration form or other document IN THE BLACK requires in order to perfect, amend or continue IN THE BLACKs security interest.</li><li>Obtain business and personal credit bureau reports in merchants and Guarantors name, respectively, at any time and<br>from time to time for purposes of verifying the merchants and Guarantors identity and current and ongoing<br>creditworthiness and deciding whether to approve the requested MCA or for any update or renewal.</li></ul><h4><strong>Privacy and Sharing of Information.</strong>&nbsp;</h4><p>IN THE BLACK will share your Personal Information with third parties only in the ways that are described in this Privacy Policy. We do not sell your Personal Information to third parties. We will provide your Personal Information to our trusted business partners and service providers to provide services to help us with our business activities, such as offering customer service or processing credit checks. These companies are authorized to use your Personal Information only as necessary to provide these services to us. We will share your basic information (name, company name, phone number, email address and requested cash advance or loan amount) with one of our business partners if we are unable to provide you with a cash advance. If you do not want us to share your Personal Information with these business partners, please contact us by email at&nbsp;intheblack.fintech@gmail.com or by postal mail at the contact information listed below. We may also disclose your Personal Information:</p><ul><li>As required by law, such as to comply with a subpoena, or similar legal process, including in a bankruptcy proceeding;</li><li>When we believe in good faith that disclosure is necessary to protect our rights, protect your safety or the safety of others, investigate fraud, or respond to a request from a governmental entity;</li><li>If IN THE BLACK is involved in a merger, acquisition, or sale of all or substantially all of its assets or equity, in which case, you will be notified via email and/or a prominent notice on our Website of any change in ownership or uses of your Personal Information, as well as any choices you may have regarding your Personal Information; and</li><li>To any other third party with your prior consent to do so.</li></ul><h4><strong>User Access and Choice.</strong></h4><p>If your Personal Information changes, or if you no longer desire our Service, you may correct, update, amend, delete/remove, ask to have it removed from a public forum or testimonial on our Website or deactivate it by emailing our Customer Support at intheblack.fintech@gmail.com or by contacting us by postal mail at the contact information listed below. We will respond to your request within 30 days. We will retain your information for as long as your account is active or as long as reasonably useful for commercial purposes. We will retain and use your information as necessary to comply with our legal obligations, resolve disputes, and enforce our agreements.</p><h4><strong>Opt-Out Policy.</strong></h4><p>IN THE BLACK and our business partners may contact you to offer you products and services that may be of interest to you. Out of respect for your privacy, you may choose to stop receiving our newsletter or marketing emails, telephone calls/texts or other forms of contact from IN THE BLACK&nbsp; and our trusted business partners by sending an email (return and delivery receipts requested, when possible) to&nbsp;intheblack.fintech@gmail.com with your full name, address, phone number, account number, and a clear statement that you no longer want to receive promotional emails and telephone calls/texts. Note that you may also follow the unsubscribe instructions included in these emails.</p><h4><strong>Tracking Technologies.</strong>&nbsp;</h4><p>Technologies such as cookies, beacons, tags and scripts are used by IN THE BLACK and our partners (for example, our marketing partners), affiliates, or analytics or service providers, including our live chat, marketing trackers, and survey tool service providers. These technologies are used in analyzing trends, administering the Website, tracking users movements around the Website and to gather demographic information about our user base as a whole. We may receive reports based on the use of these technologies by these companies on an individual as well as aggregated basis. A cookie is a small text file that is stored on a users computer for record-keeping purposes. We use cookies for user authentication and analytics. Users can control the use of cookies at the individual browser level. If you reject cookies, you may still use our Website, but your ability to use some features or areas of our Website may be limited. If you would like to learn more about cookies or how to configure your browser, please visit www.allaboutcookies.org.</p><h4><strong>Log Files.</strong></h4><p>As is true of most websites, we gather certain information automatically and store it in log files. This information may include internet protocol (IP) addresses, browser type, internet service provider (ISP), referring/exit pages, operating system, date/time stamp, and/or clickstream data. We may combine this automatically collected log information with other information we collect about you. We do this to improve services we offer you and to improve marketing, analytics, and Website functionality.</p><h4><strong>Behavioural Advertising/Re-Targeting.</strong>&nbsp;</h4><p>We partner with third parties to display advertising on our Website and manage our advertising on other sites. Our third party partners may use technologies such as cookies to gather information about your activities on this Website and other sites in order to provide you advertising based upon your browsing activities and interests. If you wish to not have this information used for the purpose of serving you interest-based ads, you may opt-out by notifying us. Please note this does not opt you out of being served advertisements. You will continue to receive generic advertisements.</p><h4><strong>Security of Information.</strong></h4><p>We take precautions to protect your information. When you submit sensitive information via the website, your information is protected both online and offline. While we use encryption to protect sensitive information transmitted online, we also protect your information offline. Only employees who need the information to perform a specific job (for example, billing or customer service) are granted access to personally identifiable information. The computers/servers in which we store personally identifiable information are kept in a secure environment.</p><h4><strong>Security of Information.</strong></h4><p>IN THE BLACK takes the security of your information very seriously. Your information is securely sent to IN THE BLACK in encrypted fashion. This creates an encrypted connection between your browser and our servers. Thus, when you enter Sensitive Personal Information (such as a credit card number) on our order forms, we encrypt the transmission of that information. If you allow IN THE BLACK to see your banking information online rather than in paper form, it is on a read-only basis. We do not have access to change, edit, or modify bank account information in any way. IN THE BLACK employees cannot view your banking username and passwords.</p><h4><strong>Links to 3rd Party Sites.</strong></h4><p>Our Website may include links to other websites whose privacy practices may differ from those of IN THE BLACK. If you submit personal information to any of those sites, your information is governed by their privacy policies. We encourage you to carefully read the privacy policy of any website you visit.</p><h4><strong>Blog/Forum.</strong></h4><p>If our Website offers publicly accessible blogs or community forums. You should be aware that any information you provide in these areas may be read, collected, and used by others who access them. To request removal of your Personal Information from our blog or community forum, contact us by email at intheblack.fintech@gmail.com or by postal mail at the contact information listed below. In some cases, we may not be able to remove your Personal Information, in which case we will let you know if we are unable to do so and why.</p><h4><strong>Testimonials.</strong></h4><p>We may display personal testimonials of satisfied customers on our Website in addition to other endorsements. With your consent, we may post your testimonial along with your name. If you wish to update or delete your testimonial, you can contact us by email at intheblack.fintech@gmail.com or by postal mail at the contact information listed below.</p><h4><strong>Social Media Widgets.</strong></h4><p>Our Website includes social media features, such as the Facebook Like button. These features may collect your IP address, which pages you are visiting on our Website, and may set a cookie to enable the feature to function properly. Social media features and widgets are either hosted by a third party or hosted directly on our Website. Your interactions with these features are governed by the privacy policy of the company providing it.</p><h4><strong>Changes To This Policy.</strong></h4><p>We may update this Privacy Policy to reflect changes to our information practices. If we make any material changes, we may notify you by email or by means of a notice on this Website prior to the change becoming effective. We encourage you to periodically review this page for the latest information on our privacy practices.</p><p>If you have any questions about this Privacy Policy, the practices of this Website, or your dealings with this Website, please contact us by email at intheblack.fintech@gmail.com or with a letter by postal mail to:</p><p>IN THE BLACK CAPITAL INC</p><p>150 ELGIN STREET</p><p>OTTAWA, ON</p><p>K2P 1L4</p><p>1800-968-9333</p><p>intheblack.fintech@gmail.com</p><p>If you are contacting us to opt-out of marketing communications, you must include your full name and business mailing email addresses and account number. Once we locate your contact information based on the information you provide us, it will be removed from our databases and mailings lists.</p><p><br>&nbsp;</p>', 0, 1, '2024-09-23 08:31:49', '2025-02-24 15:54:46');
